import axios from 'axios'
const API_URL = require('./api');

class InterestService {
    getInterestList() {
        return axios.get(API_URL + "interests").then((response) => {
            console.log(response);
        }, (error) => {
            console.log(error);
        });
    }
}

export default new InterestService();
